package main

import "fmt"

func lengthOfLongestSubstring(s string) int {
	var left, right, max int
	m := make(map[uint8]bool)

	length := len(s)
	for left < length && right < length {
		// 直至不存在
		for m[s[right]] == true {
			m[s[left]] = false
			left++
			continue
		}

		if max < right-left+1 {
			max = right - left + 1
		}

		m[s[right]] = true
		right++
	}

	return max
}

